(0, 540, 'HSBC', 'shandatt', '2020-02-06', '1047343', 'Open', '2020-01-03', 4, 'asaheer', 'Bangalore', -10, 0, -10, 0, 0, 0, 0, 0, 0, -7, 0, 0, 0, 0, 0, 0, 0, 0, 0, 'It is not possible to understand what is going on this ticket and what is the impact. Please document the requirement, current status, and next action properly. Also, this ticket has not been updated for quite long. Can you please do the needful.', 0, 0, 20, 20, 18, 18, 10, 10, 25, 25, 73, 73),
